import './App.css';

export default function App() {
  return (
      <div className="flex p-6 mx-auto bg-slate-400 dark:bg-slate-800 uppercase text-sky-500">
          <a href={"/"} className={"hover:text-sky-600"}>home</a>

          <li className={"right-0 space-x-5 mx-6 absolute"}>
              <a className={"hover:text-sky-600"}>about</a>
              <a className={"hover:text-sky-600"}>contact</a>
          </li>
      </div>
  );
}
